import React from 'react';
import styles from '../styles/BookNowPage.module.css';

function BookNowPage() {
    return (
        <div className={styles.pageContainer}>
            <header className={styles.hero}>
                <h1>Book Your Trip</h1>
                <p>Your adventure is just a few clicks away. Letâ€™s get started!</p>
            </header>
            <section className={styles.bookingSection}>
                <form>
                    <label htmlFor="destination">Destination:</label>
                    <input type="text" id="destination" placeholder="Enter Destination" />

                    <label htmlFor="dates">Travel Dates:</label>
                    <input type="text" id="dates" placeholder="MM/DD/YYYY - MM/DD/YYYY" />

                    <label htmlFor="people">Number of People:</label>
                    <input type="number" id="people" placeholder="Number of Travelers" />

                    <button type="submit" className={styles.bookButton}>Book Now</button>
                </form>
            </section>
        </div>
    );
}

export default BookNowPage;
